import React, { useEffect, useState } from "react";
import { getAll } from "../BooksAPI";
// import { get } from "../BooksAPI";
// import axios from 'axios'
function GetAllBooks() {
  const [books, setBooks] = useState({
    loading: true,
    books: [],
    error: "",
  });
  useEffect(() => {
    getAll().then((res) => {
      setBooks({
        loading: false,
        books: res,
        error: "",
      });
    });
  }, []);
  console.log(books);
  return <div></div>;
}

export default GetAllBooks;
